function chkWeight(){
				
	if($j("input[name='products_weight']").val() > $j(".descriptionselect option:selected").attr("maxweight")){
		var msg;
		if(!$j(".descriptionselect option:selected").attr("maxweight_msg"))
			msg = "Maximum weight for '"+$j(".descriptionselect option:selected").html()+"' is "+$j(".descriptionselect option:selected").attr("maxweight")+" kgs."
		else
			msg = $j(".descriptionselect option:selected").attr("maxweight_msg");
			
		//$j("input[name='products_weight']").validationEngine('showPrompt',msg,false);
		alert(msg)

		$j("input[name='products_weight']").focus().select();
			
		return false;
	}
	else{
		return true
	}
}

function validateIt(height, length, depth){
	var weight = $j("input[name='products_weight']");
	var description = $j("select[name='description']")
	var TailLift = $j("select[name='TailLift']").val();
	if (!description.val() || description.val().length==0){
		//description.validationEngine('showPrompt','please select a package description','error','topLeft',true);
		alert("please select a package description")
		return false;
	}
	else if (!weight.val() || weight.val()==0 || !height.val() || height.val()==0 || !depth.val() || depth.val()==0 || !length.val() || length.val()==0)
	{
		if (!weight.val() || weight.val()==0)
			//weight.validationEngine('showPrompt','please enter a weight','error','topRight',true);
			alert("please enter a weight")
		if (!height.val() || height.val()==0)
			//height.validationEngine('showPrompt','please enter a height','error','topRight',true);
			alert("please enter a height")
		if (!depth.val() || depth.val()==0)
			//depth.validationEngine('showPrompt','please enter a depth','error','topRight',true);
			alert("please enter a depth")
		if (!length.val() || length.val()==0)
			//length.validationEngine('showPrompt','please enter a length','error','topRight',true);
			alert("please enter a length")
		return false;
	}
	
	else if (weight.val()>80 && !(TailLift == 2 || TailLift == 3)){
		//weight.validationEngine('showPrompt',"Individual items over 80kgs require a 'Tail-Lift Truck' service to be added at the pickup and/or delivery address, otherwise drivers may refuse to pickup and/or deliver the goods, resulting in additional charges to you. A 'Tail-Lift Truck' pickup is optionable if you have a forklift available to help load the goods. However a 'Tail-Lift Truck' delivery service is mandatory and can be added to the quoting process from the options listed here",'error','topRight',true);
		alert("Individual items over 80kgs require a 'Tail-Lift Truck' service to be added at the pickup and/or delivery address, otherwise drivers may refuse to pickup and/or deliver the goods, resulting in additional charges to you. A 'Tail-Lift Truck' pickup is optionable if you have a forklift available to help load the goods. However a 'Tail-Lift Truck' delivery service is mandatory and can be added to the quoting process from the options listed here")
		return false;
	}
	
	else
		return true
}

